import React from 'react';
import 'video.js/dist/video-js.css';
import VideoPlayer from './video.js';

function App() {
  const videoJsOptions = {
    autoplay: true,
    controls: true,
    sources: [{
      src: 'http://localhost:8000/live/STREAM_NAME.flv',
      type: 'video/x-flv'
    }]
  };

  return (
    <div>
      <h1>FLV Player</h1>
      <VideoPlayer { ...videoJsOptions } />
    </div>
  );
}

export default App;
